&nbsp;
Ai y&ecirc;u s&aacute;ch hẳn kh&ocirc;ng c&ograve;n lạ g&igrave; với c&aacute;i t&ecirc;n học giả Nguyễn Hiến L&ecirc; &ndash; một nh&agrave; văn, nh&agrave;...

Học Cách Học
Cách cho tâm trí lang thang để kích hoạt chế độ tập trung học tập;
Cách ra khỏi “tư duy lối mòn” để tư duy bứt phá;
Cách để biến một trí nhớ kém trở thành lợi thế tư duy;
Cách đơn giản...

Kế hoạch Bí ngô là cuốn sách “hoàn hảo” dành cho:

Những cá nhân đang dành trọn tâm huyết để gây dựng một doanh nghiệp thành công rực rỡ;
Những doanh nhân đang kiệt quệ vì giấc mơ kinh doanh đã biến...
